import {useFrame} from "@react-three/fiber";
import {useRef} from "react";

export default function Cube() {
    const boxRef = useRef()
    useFrame(state => (boxRef.current.rotation.x += 0.02))

    return (
        <mesh ref={boxRef}>
            <boxGeometry args={[3.5,3.5,3.5]}/>
            <meshStandardMaterial color={"#D6F42A"}/>
        </mesh>
    )
}
